import (
	context "context"
	rapiddocs "github.com/multi-url-environment-no-default/rapiddocs"
	rapiddocsclient "github.com/multi-url-environment-no-default/rapiddocs/client"
	option "github.com/multi-url-environment-no-default/rapiddocs/option"
)

client := rapiddocsclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
	option.WithBaseURL(
		rapiddocs.Environments.Production,
	),
)
err := client.Ec2.BootInstance(
	context.TODO(),
	&rapiddocs.BootInstanceRequest{
		Size: "size",
	},
)

